function initAudioContext() {
    if (audioContext == null) {
        const audioCtx: AudioContext = new ((<any>window).AudioContext || (<any>window).webkitAudioContext)();
        audioContext = audioCtx;

        analyser = audioContext.createAnalyser();
        analyser.smoothingTimeConstant = 0.0;
        analyser.fftSize = 8192;
        analyser.smoothingTimeConstant = 0;
    }
}


function clearSpectogram() {
    let specCtx = (<HTMLCanvasElement>document.getElementById("spectogram")).getContext("2d")!;
    let color = palette.getColorFromLookupAt(0);
    specCtx.fillStyle = `rgb(${color.red},${color.green},${color.blue})`;
    specCtx.fillRect(0, 0, specCtx.canvas.width, specCtx.canvas.height);
}

