async function analyzeMicAudioSource(stream: MediaStream) {
    microphoneStream = stream;
    source = audioContext.createMediaStreamSource(stream);
    source.connect(analyser);


    sampleRate = audioContext.sampleRate;
    update();
}


async function analyzeAudioSource(arr: ArrayBuffer) {
    const buffer = await audioContext.decodeAudioData(arr);
    initSource(buffer);
    update();
}

function initSource(buffer: AudioBuffer) {
    source = audioContext.createBufferSource();
    let s = <AudioBufferSourceNode>source;
    s.buffer = buffer;
    s.connect(analyser);
    s.connect(audioContext.destination);
    s.start(0);
    s.onended = () => {
        initSource(buffer);
    }
    sampleRate = buffer.sampleRate;
}

function update() {

    requestAnimationFrame(update);

    const dataArray = new Uint8Array(analyser.frequencyBinCount);
    analyser.getByteFrequencyData(dataArray);

    let topPeaks = drawFrequencies(dataArray);
    drawSpectogram(dataArray, topPeaks);
}


function drawFrequencies(arr: Uint8Array) {
    const canvas = <HTMLCanvasElement>document.getElementById("frequency");
    const ctx = canvas.getContext("2d")!;


    const freqStep = 1 * sampleRate / analyser.fftSize;

    // constrain the analysis to 0-20000Hz
    // 20000Hz is in index 
    const upperIndex = Math.floor(UPPER_FREQUENCY / freqStep);

    canvas.width = upperIndex;
    canvas.height = 200;

    ctx.fillStyle = "white";
    ctx.fillRect(0, 0, canvas.width, canvas.height);

    ctx.strokeStyle = "black";

    let movingAvg = movingAverage(arr, 32);

    let maxIdx = -1;
    let max = 0;

    let startOfPeak = -1;

    let peaks = [];

    let factor = 0.7;

    for (let i: number = 0; i < upperIndex; i++) {

        let h = arr[i] / 255 * canvas.height;

        if (movingAvg[i] < factor * arr[i]) {
            ctx.strokeStyle = "red";
        } else {
            ctx.strokeStyle = "black";
        }
        ctx.beginPath();
        ctx.moveTo(i, canvas.height - 1);
        ctx.lineTo(i, canvas.height - 1 - h);
        ctx.stroke();


        if (arr[i] > max) {
            max = arr[i];
            maxIdx = i;
        }


        if (movingAvg[i] < factor * arr[i] &&
            movingAvg[i - 1] >= factor * arr[i - 1])
            startOfPeak = i;
        else if (movingAvg[i - 1] < factor * arr[i - 1] &&
            movingAvg[i] >= factor * arr[i]) {
            // end of peak
            peaks.push({ start: startOfPeak, end: i, max: max, maxIdx: maxIdx });
            max = 0;
        }
    }

    ctx.strokeStyle = "red";
    ctx.beginPath();
    ctx.moveTo(0, canvas.height - 1 - movingAvg[0] / 255 * canvas.height);
    for (let i: number = 1; i < upperIndex; i++) {
        ctx.lineTo(i, canvas.height - 1 - movingAvg[i] / 255 * canvas.height);
    }
    ctx.stroke();

    // find peaks that are of even distance to each other, those are 
    // the peaks part of the harmonics

    let nrOfTopPeaks = 20;
    let topPeaks = [];
    peaks.sort((a, b) => b.max - a.max);
    ctx.fillStyle = "blue";
    for (let i: number = 0; i < Math.min(nrOfTopPeaks, peaks.length); i++) {
        const peak = peaks[i];
        ctx.beginPath();
        ctx.arc(peak.start + (peak.end - peak.start) / 2, canvas.height / 2, 3, 0, Math.PI * 2);
        ctx.fill();
        topPeaks.push(peak);
    }

    // let sorted by frequency
    topPeaks.sort((a, b) => a.start - b.start);


    let maxEnergy = 0;
    let maxPeakHarmonicEnergy = 0;

    for (let i: number = 0; i < topPeaks.length; i++) {
        let peak = topPeaks[i];

        let sumEnergy = arr[peak.maxIdx];
        for (let j: number = 2; j < 12; j++) {
            let checkIdx = peak.maxIdx * j;

            let matchingPeaks = topPeaks.filter(p => checkIdx >= p.start && checkIdx < p.end);
            if (matchingPeaks.length > 0) {
                for (let k: number = matchingPeaks[0].start; k <= matchingPeaks[0].end; k++) {
                    sumEnergy += arr[k];
                }
            }
        }
        if (maxEnergy < sumEnergy) {
            maxEnergy = sumEnergy;
            maxPeakHarmonicEnergy = peak.maxIdx;
        }
    }

    //console.log(maxEnergy);
    let fundementalFreq = maxPeakHarmonicEnergy * sampleRate / analyser.fftSize;

    ctx.fillStyle = "green";
    ctx.beginPath();
    ctx.arc(maxPeakHarmonicEnergy, canvas.height / 2, 5, 0, Math.PI * 2);
    ctx.fill();
    /* for (let j: number = 2; j < 6; j++) {
         let checkIdx = maxPeakHarmonicEnergy * j;
         ctx.fillStyle = "green";
         ctx.beginPath();
         ctx.arc(checkIdx, canvas.height / 2, 5, 0, Math.PI * 2);
         ctx.fill();
 
     }*/

    /*for (let i: number = 1; i < topPeaks.length - 1; i++) {
        let p1 = topPeaks[i - 1];
        let p2 = topPeaks[i];
        let p3 = topPeaks[i + 1];

        let diffInDistance = Math.abs(p2.maxIdx - p1.maxIdx) -
            Math.abs(p3.maxIdx - p2.maxIdx);

        if (diffInDistance < 2) {
            // ok is part of harmonic
            const freq = (p1.maxIdx) * sampleRate / analyser.fftSize;
            if (freq >= 85 && freq < 255) {
                fundementalFreq = freq;
                break;
            }
        }
    }*/

    document.getElementById("highestFreq").textContent = fundementalFreq + " Hz";

    return topPeaks;

    /*
            // find peak length (assuming /\ and no jitter on the peak )
            let endMaxIdx = maxIdx;
            while (endMaxIdx < arr.length && arr[endMaxIdx] == max)
                endMaxIdx++;
    
            const freq = (maxIdx + (endMaxIdx - maxIdx) / 2) * sampleRate / analyser.fftSize;
            document.getElementById("highestFreq").textContent = freq + " Hz";
            */
}


function movingAverage(arr: Uint8Array, wndSize: number): number[] {
    let values: number[] = [];


    let sum = 0;
    for (let i: number = 0; i < wndSize; i++) {
        sum += arr[i];
    }
    values.push(sum / wndSize);
    for (let i: number = 1; i < arr.length - wndSize; i++) {
        sum -= arr[i - 1];
        sum += arr[i + wndSize - 1];
        values.push(sum / wndSize);
    }
    for (let i: number = 0; i < wndSize / 2; i++) {
        values.unshift(values[0]);
    }
    for (let i: number = 0; i < wndSize; i++) {
        values.push(values[values.length - 1]);
    }

    return values;
}

